import "./App.css";
import Header from "./Header/Header";
import Footer from "./footer";
import Home from "./Home";
import Card from "./Header/Card";

import Welcome from "./sections/Welcome";

import Sport from "./sports";


function App() {
  return (
    <div className="App">
    <Home />
   <Welcome />
    
     <Card />

   
      <Welcome />
      <Sport/>
      <Footer/>
    </div>
  );
}

export default App;
